import React from "react";
import { FormControl as FC} from "@mui/material";

export function FormControl({children}:{children:any}) {
    return <>{children}</>
    return <FC variant="standard" sx={{ m: 1, minWidth: 150, maxWidth: 150}}>{children}</FC>;
}
